/*********************************************************************
*
*       Static code
*
**********************************************************************
*/
/*********************************************************************
*
*       _cbBk
*/
static void _cbBk(WM_MESSAGE * pMsg) {
  switch (pMsg->MsgId) {
  case WM_PAINT:
    GUI_SetBkColor(GUI_BLACK);
    GUI_Clear();
    GUI_DrawRect(5, 5, 65, 65);
    GUI_DispStringAt("Click inside the rectangle", 80, 5);
    break;
  default:
    WM_DefaultProc(pMsg);
    break;
  }
}

/*********************************************************************
*
*       _cbButton
*/
static void _cbButton(WM_MESSAGE * pMsg) {
  const GUI_BITMAP * pBm;
  int                xPos;
  int                yPos;

  switch (pMsg->MsgId) {
  case WM_PAINT:
    pBm = BUTTON_GetBitmap(pMsg->hWin, BUTTON_BI_PRESSED);
    xPos = (WM_GetWindowSizeX(pMsg->hWin) - pBm->XSize) / 2;
    yPos = (WM_GetWindowSizeY(pMsg->hWin) - pBm->YSize) / 2;
    if (BUTTON_IsPressed(pMsg->hWin)) {
      GUI_DrawBitmap(pBm, xPos, yPos);
    }
    break;
  default:
    BUTTON_Callback(pMsg);
    break;
  }
}

/*********************************************************************
*
*       Public code
*
**********************************************************************
*/
/*********************************************************************
*
*       MainTask
*/
void MainTask(void) {
  WM_HWIN hButton;

  GUI_Init();
  WM_SetCallback(WM_HBKWIN, _cbBk);
  hButton = BUTTON_CreateEx(10, 10, 50, 50, WM_HBKWIN, WM_CF_SHOW, 0, GUI_ID_BUTTON0);
  BUTTON_SetBitmap(hButton, BUTTON_BI_PRESSED, &bmBitmap_50x50);
  WM_SetCallback(hButton, _cbButton);
  while (1) {
    GUI_Delay(100);
  }
}

